import Notes from './Notes';

const Home = () => {
    return (
        <div className="container my-5">
            <h2>Welcome to iNotebook Home!</h2>
            <p>You are successfully logged in.</p>
            <hr />
            <Notes />
        </div>
    );
};

export default Home;
